import "./App.css";
import Header from "./Header/Header";
import Button from "./Button/Button";
import { Router, Route } from "react-router-dom";
import Home from "./Home";

function App() {
  return (
    <div>
      <Router>
        <div>
          <Route exact path="/Home" component={Home} />
        </div>
      </Router>
    </div>
  );
}

export default App;
